import copy

DIRECTIONS = ['U', 'R', 'D', 'L']
STEPS = {}

def step(p, d):
    (x, y) = p
    match d:
        case "U":
            return x, y - 1
        case "R":
            return x + 1, y
        case "D":
            return x, y + 1
        case "L":
            return x - 1, y

def get_wall(p, g, d):
    try:
        match d:
            case "U":
                return g[p[1] - 1][p[0]] == "#"
            case "R":
                return g[p[1]][p[0] + 1] == "#"
            case "D":
                return g[p[1] + 1][p[0]] == "#"
            case "L":
                return g[p[1]][p[0] - 1] == "#"
    except IndexError:
        return True

def find_shortest_path_no_cheating(grid, start_pos):
    pos_list = [(start_pos[0], start_pos[1], [start_pos])]
    visited = [(start_pos[0], start_pos[1])]
    best_path = []

    end = False
    steps = -1
    while not end:
        steps += 1
        pos_list_new = []

        for pos in pos_list:
            if grid[pos[1]][pos[0]] == 'E':
                best_path = pos[2]
                end = True
                break

            for direction in DIRECTIONS:
                if get_wall((pos[0], pos[1]), grid, direction):
                    continue

                new_pos = step((pos[0], pos[1]), direction)
                if new_pos[0]< 0 or new_pos[1] < 0 or new_pos[0] == len(grid[0]) or new_pos[1] == len(grid):
                    continue

                new_state = (new_pos[0], new_pos[1])
                if new_state not in visited:
                    visited.append((new_state))

                    track = copy.deepcopy(pos[2])
                    track.append(new_pos)
                    new_state = (new_pos[0], new_pos[1], track)
                    pos_list_new.append(new_state)

        pos_list = pos_list_new

    return best_path

def calculate_distances_no_cheating(path, max_steps):
    for i, p in enumerate(path):
        STEPS[p] = max_steps-i-1

def get_distance(p1, p2):
    return abs(p1[0]-p2[0]) + abs(p1[1]-p2[1])

def my_fancy_new_strategy(limit, cheats):
    shortcuts = 0
    keys = [k for k in STEPS.keys()]
    for i1, k1 in enumerate(keys):
        for i2 in range(i1+1, len(keys)):
            k2 = keys[i2]
            d = get_distance(k1, k2)
            min_way = STEPS[k1]
            max_way = STEPS[k2]
            if min_way > max_way:
                min_way = max_way
                max_way = STEPS[k1]

            if d <= cheats and (max_way - min_way - d) >= limit:
                shortcuts += 1
    return shortcuts

